const pageVariant = {
    in: {
        opacity: 1,
        x:"0"
    },
    out: {
        opacity: .5,
        x:'-100vh'
    }
}

const PageTransition = {
    type:"tween",
    ease: 'linear'
}

export default {pageVariant, pageTransition };
